import 'react-perfect-scrollbar/dist/css/styles.css'
import 'nprogress/nprogress.css'
import "react-awesome-lightbox/build/style.css";
import App from './App';
const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
    <App />
